import styled from "styled-components"

export const Container = styled.footer `

    width: 100%;
    height: fit-content;
    position: absolute;
    bottom: 0;
    display: flex;
    justify-content: center;


    div {
        display: flex;
        margin: auto 0 auto 0 auto;
        width: 100%

    }

    img {
        width: 2.25rem;
        height: 2.25rem;
        border-radius: 50%;
    }

`;
